import React from 'react';
import { translate } from 'react-translate';
import { withStyles } from '@material-ui/core/styles';

const styles = {
  root: {
    backgroundColor: '#fff'
  },
};

const SectionThird = props => {
  const { title, section1Title, section1Content, section2Title, section2Content, callToAction } = props;
  return (
      <div className={classes.root}>
        <h2>{title}</h2>
        <h3>{section1Title}]</h3>
        <p>{section1Content}</p>
        <h3>{section2Title}</h3>
        <p>{section2Content}</p>
        <a>{callToAction}</a>
      </div>
  );
};

export default withStyles(styles)(translate('Banner')(SectionThird));
